import React from 'react';
import Detailcard from './Detailcard'
import Mobiles from './List'

const Detail = (props) => {
    <>
        <h1>This is the Mobile You have selected</h1>
        {Mobiles.map((value) => {
            return (
                <Detailcard
                    imgsrc={value.imgsrc}
                    title={value.title}
                />
            );
        })}
    </>
}

export default Detail;
